INSERT INTO `v1_85002a9b8d192e1d16d814f2231939d7749543850b097e9e43335b178e406cd0` VALUES (0.8, "マコトさん？\nどうかしましたか？\n何やら不穏な気配を\n感じ取ったのですが", 0, 0, 129911, 1, 6, 6, 11, 6011, 0);
