INSERT INTO `v1_85002a9b8d192e1d16d814f2231939d7749543850b097e9e43335b178e406cd0` VALUES (0.3, "私の班のみなさんも\n変わらず訓練に励んで\nいるようですわね\n殊勝なことです", 0, 0, 129911, 1, 7, 6, 11, 7006, 0);
