INSERT INTO `v1_85002a9b8d192e1d16d814f2231939d7749543850b097e9e43335b178e406cd0` VALUES (0, "エリコ班の急成長は\n騎士団の中でも話題に\nなってたからな\nホントすげえ奴等だよ", 0, 0, 129811, 1, 7, 6, 11, 7011, 0);
